import React from 'react'
import { useSelector } from 'react-redux'
// kêt nối react-reduct
const ModalGioHangRedux = () => {
    const gioHang = useSelector((state)=>{
        return {
            gioHang: state.gioHang
        }
    });
    console.log(gioHang);

    const listGioHang = ()=>{
        gioHang.map((item, index)=>{
            <tr key={index}>
                <td>{item.maSP}</td>
                <td>{item.tenSP}</td>
                <td>{item.hinhAnh}</td>
                <td>{item.soLuong}</td>
                <td>{item.giaBan}</td>
            </tr>
        })
    }

  return (

    <div>ModalGioHangRedux</div>
  )
}

export default ModalGioHangRedux
